import React, { useState } from "react";
import styles from "../../Css/nav.module.css";
import logo from "../../Images/dmlogo.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars } from "@fortawesome/free-solid-svg-icons";
import {Link} from "react-router-dom"

function Nav() {
  const [showLinks, setShowLinks] = useState(false);

  const handleClick = () => {
    !showLinks ? setShowLinks(false) : setShowLinks(true);
  };

  const [navActive, setNavActive] = useState (true)

  return (
    <div className={styles.Navbar}>
      <div className={styles.leftNav}>
        <img src={logo} alt="Dumbmerch logo" />
      </div>
      <div className={styles.rightNav}>
        <div className={styles.links} id={showLinks ? "hidden" : ""}>
          <Link to="/complain"><p>Complain</p></Link>
          <Link to="/profile" onClick={setNavActive}><p id={navActive ? "active" : ""} >Profile</p></Link>
          <Link to="/"><p>Logout</p></Link>
        </div>

        <label htmlFor="#Bars" className={styles.Bars}>
          <FontAwesomeIcon icon={faBars}></FontAwesomeIcon>
          <button id="Bars" onClick={handleClick}></button>
        </label>
      </div>
    </div>
  );
}

export default Nav;
